import React from "react";

const Options = () => {
  return (
    <div>
      <iv>
        <ul>
          <li>Create Activity</li>
          <li>Edit Activity</li>
          <li>Delete Activity</li>
        </ul>
      </iv>
    </div>
  );
};

export default Options;
